C.aSs=new L.D('In addition to the tapped indexes, the destination\'s named route is included as a return value in the class. The "Tapped via" source, index change "Direction" are also included. You can use this information to determine how you want to navigate to the destination.\n\nThis demo shows how the destination information can be used to build different page transitions depending on which menu you navigate from. For example, from locked side menu there is no page transition. This works well with Web and desktop navigation. It is focused and quick, also animation of large surfaces on desktop sizes can be very distracting. At most a very quick and subtle fade through could be used if some navigation animation is desired. For this demo it was opted to not have any animation for this navigation type.\n\nFrom a rail or a drawer the FadeTrough transition from the Flutter Animations packages is used. This works well in tablet mode or when the direction of the navigation is uncertain. We can also see that only the actual content of the page animates. The rail, bottom bar, app bar and sidebar do not animate and remain fixed.\n\nThe bottom navigation uses a shared axis transition. This creates a slight sideways motion as the bottom destinations are clicked, without the same feeling that they are a part of same view that sliding animations imply, which would also suggest swiping navigation is available. Swiping navigation is not available here, since in this demo we consider the bottom navigation destinations to be independent of each other.\n\nThe purpose of these different page transition types are to use transitions that fit the most likely used device for the navigation type. This type of adaptive page transition, is not a part of Flexfold. However, the "onDestinationSelected" callback returns the information needed to implement it, like this demo does.\n',null,null,null,null,null,null,null,null,null)
C.aSu=new L.D("Tooltips are nice, but can get in the way when you know the app. Flexfold allows your app to turn off its tooltips. Why not give users this choice for all other tooltips in your app too? Turning OFF this setting also turns OFF all the API tooltips on the controls in this demo.",null,null,null,null,null,null,null,null,null)
C.aSv=new L.D("This demo shows how you can make app bars more interesting by introducing a gradient, together with optional transparency that increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the gradient transparency is used to display content behind the app bar, as content scrolls below it.\n\nA transparent gradient that is fully opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is always legible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the scrolling behind the app bar or don't use the optional styled app bar constructor at all.\n",null,null,null,null,null,null,null,null,null)
