C.aSC=new L.D('This feature is required so you do not get stranded without a way back to bottom bar destinations in this navigation mode. Another and a better way to tackle this is to push the destinations that are only in the drawer in this navigation mode as new modal full screen on top of the entire Flexfold scaffold, with only back navigation option available. This is the normal and often preferred way of navigating from such extra drawer destinations on a phone.\n\nThis example application has been designed to do so by default, by using the "use modal" info returned by the FlexfoldSelectedDestination information for such destinations, which are Preview, Help and About in this demo app.\n\nEven when using this capability, it is still potentially possible to get stranded. If you in rail or menu mode navigate to Preview, Help or About the destination should not be pushed as a full screen with only back option, preferably we should only get the destination content replaced into the body part of the app. This demo app works this way. However, in this mode if you then resize the canvas to enable bottom navigation mode, the Preview, Help and About views in this app do not know that they should change to full screen view with a back button, to take you back to last used bottom navigation destination. With Flexfold, navigation to the bottom destinations will still be possible even in this rare scenario, since the destinations are now available in the drawer.',null,null,null,null,null,null,null,null,null)
