C.aT4=new L.D("The breakpoints for when the navigation mode changes, can be adjusted. The defaults work well enough for most use cases.\n\nTo keep the rail as slim as possible, navigation destination labels only appear as tooltips in rail mode. This results in a slim un-intrusive icon only rail, that is suitable for tablets in portrait mode and if so desired it can also be used in landscape mode on phones or even portrait mode on large phones in some use cases.\n\nThe end drawer can also become a permanent fixture on a wide enough canvas as a sidebar. The sidebar entrance is also animated. The sidebar's visibility can also be toggled with its menu button.\n\nThe width of the rail, side menu and the sidebar can all be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The Flexfold API has a few more features than those demonstrated here.\n\nYou will find the key settings on the Settings page, but there are some usage hints on other pages in this demo as well.",null,null,null,null,null,null,null,null,null)
