C.aTo=new L.D("The theming shown here is done with a package called FlexColorScheme. This page shows the kind of theming it simplifies.\n\nFlexColorScheme uses Flutter's newer ColorScheme based themes. Similarly to the ThemeData from factory, it also creates Themes from color schemes. It has two convenience factories, FlexColorScheme light and dark. It also addresses some theme gaps in the standard Theme from color scheme based theming.\n\nFlexColorScheme supports using Material and custom colored app bar themes in light and dark mode. Dark theme mode also support an even darker mode, called true black.\n\nYou can blend primary color into surface colors with different strengths, to create color branded light and dark themes.\n",null,null,null,null,null,null,null,null,null)
