C.aUw=new L.D("Tooltips are light on light, and dark on dark",null,null,null,null,null,null,null,null,null)
C.aUy=new L.D("Just because we can and for fun, let us show all the beautiful Undraw SVG images used in this demo app in a grid and then randomly animate in a new one.\n\nEach image box that randomly display one of the images has its own random wait duration before it switches and also a random switch animation time.\n\nEach time the screen is built, each image box gets a random colored border and a less saturated version of it is calculated for dark mode. When you switch to dark mode, it still has the same color hue based on the light theme's random color.\n\nAnother feature is that every image is color themed dynamically to match the color of its border. This is done by changing a color text string in the SVG file image data.\n",null,null,null,null,null,null,null,null,null)
C.aUB=new L.D("Normal responsive behavior is to only show bottom navigation when the width is below its breakpoint. With this setting ON it will be shown whenever the rail/menu is hidden. For this demo app, this is ON by default, but API default is OFF.",null,null,null,null,null,null,null,null,null)
