C.aUF=new L.D("Show the bottom navigation bar also when the rail or menu is shown. CAUTION: Not recommended, it can be confusing. Used mostly for testing purposes, but it may also be useful as an accessibility feature. In this demo it is a handy way to see the bottom navigation bar regardless of canvas size.",null,null,null,null,null,null,null,null,null)
C.aUG=new L.D("Use modal routes when appropriate",null,null,null,null,null,null,null,null,null)
C.aUI=new L.D("A toggle function to show and hide the menu is built in to the menu button. It can be used to hide the side menu or rail, to make more space available for app content. On a desktop sized canvas you can hide the menu completely or make it a rail. A similar toggle control is also available for the optional sidebar.\n\nThe tooltips on the settings below show the Flexfold API used and its current value based on the control setting. You can turn OFF the tooltips under Other settings. The purpose of these API tooltips is to function as an interactive reference guide to the Flexfold API.",null,null,null,null,null,null,null,null,null)
C.aUK=new L.D("Try some settings...",null,null,null,null,null,null,null,null,null)
C.aUR=new L.D("Default API value is 246 ms, this matches the Material Drawer animation time.",null,null,null,null,null,null,null,null,null)
C.aUQ=new L.D("When enabled and combined with a transparent app bar, you can see content scroll behind it.",null,null,null,null,null,null,null,null,null)
C.aUU=new L.D("When you have destinations in a bottom navigation bar and additional destinations in a drawer, you usually want the navigation to such additional destinations to be modal when you navigate to them and your canvas is phone sized that does not show all the destinations in a rail or side menu.\n\nWith Flexfold you can use the source of the navigation to determine if you want push a full screen route on top of the Flexfold scaffold with only back option available or push a replacement named version of it, into the body part.\n\nFlexfold does not normally show bottom navigation bar destinations in the drawer during bottom bar navigation mode. However, if you navigate to a destination in bottom navigation mode that is not on the bottom navigation bar, then if you open the drawer again after this, you will find the bottom navigation bar destinations in the drawer.\n",null,null,null,null,null,null,null,null,null)
C.aUW=new L.D("Transparent bottom navigation bar",null,null,null,null,null,null,null,null,null)
