C.aV1=new L.D("The switch list tile is ON",null,null,null,null,null,null,null,null,null)
C.aV2=new L.D("Flexfold is a smooth responsive scaffold package for Flutter. This application demonstrates its core features.\n\nThe responsive navigation modes automatically change from bottom navigation bar, to rail and to side menu as the canvas size grows. The smooth part is that the switches from one mode to another are animated.\n\nOn a large canvas the user can control the desired navigation mode with the menu button and toggle the side menu from being hidden in a drawer, to a rail and to be fully visible as a side menu. You change navigation mode by clicking on the menu button. The menu button only toggles the menu style between allowed navigation modes based on current canvas size and defined navigation mode breakpoint constraints.\n",null,null,null,null,null,null,null,null,null)
C.aV3=new L.D("Company Inc",null,null,null,null,null,null,null,null,null)
C.aV6=new L.D("\nThe sidebar can be used to hold less used content in an application. It could be a search filter, a list of picked or selected items, maybe even usage instructions and guides.\n\nWhen you define Flexfold destinations, you can define which destinations should have a sidebar, every destination does not have to have one. In this demo app only the Settings, Theme, Tabs and Slivers destinations have a sidebar, the other pages do not have one.\n",null,null,null,null,null,null,null,null,null)
